export const required = value => {
    if (value) {
        return undefined;
    }
    
    return "Field is required";
}

export const maxLength30 = value => {
    if (!value) {
        return "Value does"
    }
    
    if (value && value.length < 30) {
        return undefined;
    }
    
    return "Field is required";
}
